import '../App.css';
import mobile from '../images/mobile.png';

function Header() {
    return (
    <div className='header'>

        <div className='headerTags'>
            <div className='assessmentText'>
                Assessment
            </div>
            <div className='myAssessmentsText'>
                My Assessments
            </div>
        </div>
        <img src={mobile} alt='mobile icon'></img>
    </div>
);
}

export default Header;
